import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';
import Card from './Card';



import 'swiper/css';

export default () => {
  return (

    <Swiper
      spaceBetween={50}
      slidesPerView={1}
      onSlideChange={() => console.log('slide change')}
      onSwiper={(swiper) => console.log(swiper)}
    >
      <SwiperSlide>
      <div className="container">
    <div className="row row-cols-3">

    <Card title="6 Master Bedrooms" para="Air condtioned with an attached balcony" logo="house"/>
    <Card title="Spacious Living Room" para="Sofa Set | Dining Area | Fully Air Conditioned"logo="couch"/>
    <Card title="25-30 Guests" para="Suitable for family, friends and corporate getaways"logo="users"/>
    <Card title="Private Swimming Pool" para="Full Size | Waterfall | Patio loungers | Underwater LED Lighting"logo="swimming-pool"/>
    <Card title="Meals" para="Vegetarian | Non-Vegetarian | Jain Meal Plan(Breakfast, Lunch, High Tea, Dinner"logo="utensils"/>
    <Card title="Music System" para="Bluetooth, USB & AUX connectivity | Karaoke"logo="music"/>
    <Card title="High-Speed WIFI" para="Speed upto 30 MBPS"logo="wifi"/>
    <Card title="Smart Television" para="Full HD 50 inch LED"logo="tv"/>
    <Card title="Online Streaming" para="Netflix | Disney + Hotstar | Amazon Prime"logo="blog"/>
    </div>
    </div> 
      </SwiperSlide>
      <SwiperSlide><div className="container">
    <div className="row row-cols-3">

    <Card title="Barbeque" para="" logo="drumstick-bite"/>
    <Card title="Sheesha" para="" logo="free=code-camp"/>
    <Card title="Bonfire" para="" logo=""/>
    <Card title="Packaged Drinking Water" para="Complimentary" logo=""/>
    <Card title="Concierge and Housekeeping Staff" para="Professional, Highly Trained and Experienced" logo=""/>
    <Card title="Mini Library" para="Fiction | Biography | Children | Fantasy" logo=""/>
    <Card title="Indoor Activities" para="Carrom | UNO | Chess | Jenga | Scrabble | Monopoly" logo=""/>
    <Card title="Outdoor Sports" para="Cricket Kit | Badminton Set | Football" logo=""/>
    <Card title="Mocktails on Arrival" para="Pina Colada | Mojito | Blue Curacao" logo=""/>

    </div>
    </div> </SwiperSlide>
      {/* <SwiperSlide>Slide 3</SwiperSlide>
      <SwiperSlide>Slide 4</SwiperSlide> */}
    </Swiper>
  );
};
